import React from 'react';
import Products from '../Products';
import {Row, Col} from 'react-bootstrap';

const HomeScreen = () => {
      return (
            <>
            <Row>
                  {
                        Product.mao(product =>{
                              <Col>
                                    <h3>{product.name}</h3>
                              </Col>
                        })
                  }
            </Row>
                  
            </>
      )
}

export default HomeScreen;
